var baseBet = 0.0001;
var base = baseBet;
var snowy = 0;
var previousBalance = ((Math.floor(parseFloat(document.getElementById('pct_balance').value)/(baseBet*100)))*(baseBet*100));
var dogshit = 0;
var beast = baseBet; // Initial bet amount
var seventy = (baseBet*69.9);
var eighty = (baseBet*79.9);
var great = parseFloat(document.getElementById('pct_balance').value);
var boghart = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
var boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
var sevens = baseBet*6.9; 
var eights = baseBet*7.9; 
 
function start() {
    great = document.getElementById('pct_balance').value;
    if ((great>(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*6.9)))&&(great<(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*7.9)))&&(great!=snowy)) {    
        beast *= 2;
        snowy = parseFloat(great);
    }
    if ((great<=(previousBalance-(baseBet*6.9)))&&(dogshit>=1)&&(great<(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*6.9)))){
        dogshit = 0;
        baseBet = base;
        snowy = 0;
        beast = baseBet; 
        boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
        previousBalance = ((Math.floor(great/(baseBet*100)))*(baseBet*100));
    }
    if ((great<=(previousBalance-(39.9*base)))&&(dogshit<=0)&&(great<(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*6.9)))){
        baseBet = base; 
        dogshit = 0;
        snowy = 0;
        beast = baseBet; 
        boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
        previousBalance = ((Math.floor(great/(baseBet*100)))*(baseBet*100));
    }  
    if ((great >= (previousBalance+(baseBet*69.9)))&&(dogshit<=0)) {
        baseBet = baseBet*10;
        beast = baseBet*2;
        dogshit = dogshit+1;
        snowy = parseFloat(great);
        boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
        previousBalance = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
    }
    if ((great>(boghart+(baseBet*10)))&&(dogshit>=1)&&(great<(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*6.9)))){
        dogshit = 0;
        baseBet = base;
        beast = baseBet;
        snowy = 0; 
        previousBalance = ((Math.floor(great/(baseBet*100)))*(baseBet*100));
        boghart = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
        boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
    }
    if ((great>(boghy+(baseBet*10)))&&(dogshit<=0)&&(great<(((Math.floor(great/(baseBet*10)))*(baseBet*10))+(baseBet*6.9)))){
        dogshit = 0;
        baseBet = base;
        beast = baseBet;
        snowy = 0; 
        previousBalance = ((Math.floor(great/(baseBet*100)))*(baseBet*100));
        boghy = ((Math.floor(great/(baseBet*10)))*(baseBet*10));
    }
    $('#pct_chance').val(49.5); 
    $('#pct_bet').val(beast.toFixed(8)); // Ensure brackets are correctly placed
    document.body.firstChild.children[5].firstChild.lastChild.lastElementChild.lastChild.click();
    setTimeout(() => start(), 1000); // Adjust timeout as needed
}
 
 
start();
